package com.example.demo;

import java.io.UnsupportedEncodingException;

import org.junit.Assert;
import org.junit.jupiter.api.Test;
//import org.springframework.boot.test.context.SpringBootTest;

import com.example.demo.service.NurseService;

//@SpringBootTest
public class SpringbootrestdemoApplicationTests {
	NurseService nurseService = new NurseService();
	byte[] bytes;
	int noOfBytes;
	boolean isSizeVaild;

	@Test
	public void givenSearchMessage_WhenSizeIsLessThan4KB_ShouldReturnTrue() throws UnsupportedEncodingException {
		String message = "";
		bytes = message.getBytes("UTF-8");
		noOfBytes = bytes.length;
		System.out.println("No of bytes in LessThan test case is " + noOfBytes);
		isSizeVaild = nurseService.isSizeVaild(message);
		Assert.assertTrue(isSizeVaild);
	}

	@Test
	public void givenSearchMessage_WhenSizeIsEqualTo4KB_ShouldReturnTrue() throws UnsupportedEncodingException {
		String message = "";
		bytes = message.getBytes("UTF-8");
		noOfBytes = bytes.length;
		System.out.println("No of bytes in EqualTo test case is " + noOfBytes);
		isSizeVaild = nurseService.isSizeVaild(message);
		Assert.assertTrue(isSizeVaild);
	}

	@Test
	public void givenSearchMessage_WhenSizeIsMoreThan4KB_ShouldReturnFalse() throws UnsupportedEncodingException {
		String message = "";
		bytes = message.getBytes("UTF-8");
		int noOfBytes = bytes.length;
		System.out.println("No of bytes in MoreThan test case is " + noOfBytes);
		isSizeVaild = nurseService.isSizeVaild(message);
		Assert.assertFalse(isSizeVaild);
	}

}
